INSERT INTO `post` VALUES ('8aa185818b3cd1ab018b3cdafd8e000a','2023-10-17 08:57:47','402881888b24a1ed018b24c46d930003',NULL,_binary '','2023-10-17 08:57:47','402881888b24a1ed018b24c46d930003','<p>Nổi bật trong lĩnh vực y tế, phòng khám Quang Trung cung cấp các dịch vụ khám đa dạng ở mọi độ tuổi.</p><p>Bên cạnh đó, chi phí thăm khám cũng được đánh giá ở mức hợp lý so với chất lượng dịch vụ. Định kỳ, phòng khám </p><p>thực hiện khảo sát lấy ý kiến đánh giá của khách hàng nhằm cải thiện và nâng cao hơn nữa chất lượng dịch vụ, mang đến trải nghiệm thăm khám tốt hơn cho các gia đình.</p><p style=\"text-align:left;text-indent:2em;\"><strong>Trang thiết bị hiện đại</strong></p><p>Hệ thống cơ sở vật chất của phòng khám được đầu tư bài bản, chuyên nghiệp với các thiết bị y tế tiên tiến giúp các y bác sĩ đưa ra những chẩn đoán chính xác.</p><p style=\"text-indent:2em;\" size=\"9\" _root=\"[object Object]\" __ownerID=\"undefined\" __hash=\"undefined\" __altered=\"false\"><strong>Không gian thoải mái và sạch sẽ</strong></p><p>Môi trường phòng khám rất quan trọng đối với cảm nhận của bệnh nhân. Chính vì vậy phòng khám sản phụ khoa Dr Thành Sơn luôn chú trọng duy trì vệ sinh sạch sẽ, bố trí máy tạo mùi hương mang đến cảm giác gần gũi và thân thiện cho khách hàng tới thăm khám.</p>','20cf2872-691d-11ee-ac53-f925cd9583d0','ecc66d84-6918-11ee-ac53-f925cd9583d0',NULL),('8aa185818b3cd1ab018b3ce5ae4c000b','2023-10-17 09:09:27','402881888b24a1ed018b24c46d930003',NULL,_binary '','2023-10-17 09:09:27','402881888b24a1ed018b24c46d930003','<p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Thiết bị giám sát (Monitoring Equipment):</span></span></span></p><p></p><p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Bao gồm máy giám sát bệnh nhân, máy theo dõi nhịp tim, máy theo dõi hô hấp, và máy đo bão hòa oxy.</span></span></span></p><p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Sử dụng để giám sát các thông số quan trọng của bệnh nhân trong thời gian điều trị và phẫu thuật.</span></span></span></p><p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Thiết bị điều trị (Treatment Equipment):</span></span></span></p><p></p><p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Gồm máy tạo oxi, máy tiêm, máy tạo nhiệt, máy tạo âm thanh siêu âm, và các thiết bị điều trị khác.</span></span></span></p><p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Được sử dụng để cung cấp liệu pháp điều trị cho bệnh nhân, chẳng hạn như cung cấp oxy, tiêm thuốc, hay làm giảm đau.</span></span></span></p><p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Thiết bị hỗ trợ (Assistive Devices):</span></span></span></p><p></p><p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Bao gồm nhiều loại sản phẩm như xe lăn, gương phản xạ, nội soi, và các thiết bị hỗ trợ khác.</span></span></span></p><p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Thiết bị này được sử dụng để hỗ trợ bệnh nhân hoặc nhân viên y tế trong việc thực hiện các hoạt động hàng ngày hoặc quá trình chẩn đoán và điều trị.</span></span></span></p><p><span style=\"color:#050505\"><span style=\"font-size:15px\"><span style=\"background-color:#e4e6eb\">Các trang thiết bị y tế phải tuân thủ các tiêu chuẩn an toàn và hiệu suất cụ thể, và cần được bảo trì và kiểm tra định kỳ để đảm bảo tính đáng tin cậy và an toàn trong việc sử dụng chúng trong ngành y tế.</span></span></span></p>','20cf2872-691d-11ee-ac53-f925cd9583d0','ecc78721-6918-11ee-ac53-f925cd9583d0',NULL);
